In C, both `static` and `register` are storage class specifiers that affect the scope, lifetime, and storage of variables. Here's a detailed explanation of each:

### Static Variables

1. **Scope and Lifetime**:
   - **Local Static Variables**: When a variable is declared `static` inside a function, it retains its value between function calls. Its lifetime is the entire duration of the program, but its scope is limited to the function in which it is declared.
   - **Global Static Variables**: When a variable is declared `static` outside of any function, it has file scope. This means it can be accessed by any function within the same file but is not visible to functions in other files.

2. **Initialization**:
   - Static variables are initialized only once, at the start of the program. If no explicit initialization is provided, they are initialized to zero.

3. **Memory Allocation**:
   - Static variables are stored in the data segment of the memory, which means they are not allocated on the stack.

4. **Example**:
