1. Add `data-sortable` attribute to your table:

```html
<table class="table" id="sortableTable" data-sortable>
  <thead>
    <tr>
      <th>Name</th>
      <th>Age</th>
      <th>Country</th>
    </tr>
  </thead>
  <tbody>
    <tr>
      <td>John</td>
      <td>25</td>
      <td>USA</td>
    </tr>
    <tr>
      <td>Anna</td>
      <td>30</td>
      <td>Canada</td>
    </tr>
    <!-- Add more rows as needed -->
  </tbody>
</table>
```

2. Add the following JavaScript code to handle sorting:

```javascript
document.addEventListener('DOMContentLoaded', () => {
  const table = document.querySelector('[data-sortable]');
  const headers = table.querySelectorAll('th');
  let sortOrder = 1; // 1 for ascending, -1 for descending

  headers.forEach(header => {
    header.addEventListener('click', () => {
      const column = header.cellIndex;
      const rows = Array.from(table.rows).slice(1);
      const sortedRows = rows.sort((a, b) => {
        const aText = a.cells[column].textContent.trim();
        const bText = b.cells[column].textContent.trim();
        return aText.localeCompare(bText, undefined, { numeric: true }) * sortOrder;
      });

      // Remove existing rows and append sorted rows
      rows.forEach(row => table.deleteRow(row.rowIndex));
      sortedRows.forEach(row => table.tBodies[0].appendChild(row));

      // Toggle sort order
      sortOrder *= -1;
    });
  });
});
```

Now, when you click on the table headers, the table will be sorted alphanumerically based on the clicked column. The sort order will toggle between ascending and descending with each click.

